import React from "react";
import "./Home.css";
function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://scontent-lht6-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/101448823_259343928752703_6676999488433469031_n.jpg?_nc_ht=scontent-lht6-1.cdninstagram.com&_nc_cat=103&_nc_ohc=kS316nNL-egAX_or9jP&oh=c4a789973eb5eb4943c09cc90934331d&oe=5F385AE2"
        alt=""
      />
    </div>
  );
}

export default Home;
